description:
CATEGORY Feature
CAST Alex Sanders, Danielle Cheeks, Kirsty Waay, Marc Wallice, Peter North, Rachel Love, Steven St. Croix

Legend Of Barbi-Q And Little Fawn, The: The west was wild, but the women were wilder.
Barbi's legend sprang from the cowboy's hunger for hot sauce on the range and a range of saucy, hot women. Land baron Simon La Greedy makes his move to take over Barbi's juicy sauce right from her pit, along with the territory. The primitive thrills of the savage and sexy Little Fawn (with her white tail in the air) stops La Greedy's treachery, and spins a legend of hot, lusty sex under the big sky.

